{
	"name": "Custom Jekyll",

	"settings": {
		"terminal.integrated.shell.linux": "/bin/bash"
	},

	"extensions": [
		"ms-azuretools.vscode-docker",
		"rebornix.Ruby"
	],

	// reuse our existing docker-compose setup
	"dockerComposeFile": [
		"docker-compose.yml"
	],

	// indicate the service we want to connect to
	"service": "app",

	// this is the default directory to use when connected
	"workspaceFolder": "/workspace",

	// open the port from the jekyll server here
	"forwardPorts": [ 4000 ],
}

{
  "trailingComma": "es5",
  "tabWidth": 2,
  "semi": true,
  "singleQuote": true
}

import jest from "eslint-plugin-jest";
import path from "node:path";
import { fileURLToPath } from "node:url";
import js from "@eslint/js";
import { FlatCompat } from "@eslint/eslintrc";

const __filename = fileURLToPath(import.meta.url);
const __dirname = path.dirname(__filename);
const compat = new FlatCompat({
    baseDirectory: __dirname,
    recommendedConfig: js.configs.recommended,
    allConfig: js.configs.all
});

export default [...compat.extends("prettier", "plugin:jest/recommended"), {
    plugins: {
        jest,
    },

    rules: {
        "no-undef": "off",
        "vars-on-top": "off",
        "no-var": "off",
        "func-names": "off",
        "one-var": "off",
        eqeqeq: "off",
        "no-param-reassign": "off",
        "no-underscore-dangle": "off",
        "no-useless-escape": "off",
        "no-restricted-globals": "off",
        "no-use-before-define": "off",
        "global-require": "off"
    },
}];

module.exports = {
  roots: ['<rootDir>/javascripts/', '<rootDir>/tests/'],
  testMatch: ['**/spec/**/*.js'],
  transform: {
    '^.+\\.jsx?$': 'babel-jest'
  },
  moduleNameMapper: {
    'tag-builder': '<rootDir>javascripts/tag-builder.js',
    'project-ordering': '<rootDir>javascripts/project-ordering.js'
  },
  automock: false,
  setupFiles: [
    './tests/setupJest.js'
  ],
  collectCoverage: true,
  collectCoverageFrom: [
    'javascripts/**/*.js',
    // infrastructure, should be ignored
    '!javascripts/lib/require.js',
    '!javascripts/app.js'

  ],
  coverageReporters: ['text-summary', 'json', 'html', 'cobertura'],
};

